import React, { Component } from 'react';
import './App.css';
import Person from './Person/Person'
class App extends Component {
  render() {
    return (
<div>
  <h1>Ismel</h1>
  <p>This is my family</p>
  <Person name="Ismel" age="27"/>
  <Person name="Karime" age="33"><h2>She is my girfriend</h2></Person>
  <Person name="Teddy" age="3" >He is our dog </Person>
</div>
    );
  } 
}
export default App;
